LIKE THIS PICTURE IF YOU THINK @flairairlines SHOULD SEND ME ON MORE TRIPS🥳✈️😂 kidding, but i will share some of my highlights of the trip below so save this for some vegas favs! i mentioned this the other day but i’ve really only ever been to vegas for birthdays + bachelorettes, so it was really nice to get to see the other side of pool parties + clubs (lol) and actually get to enjoy some of the amazing shows, nature + restaurants that vegas has to offer🫶🏼✨

EATS:
@catch food is always amazing + this location is beautiful! food, cocktails + vibe were perfect
sadelles: one of my favourite places to brunch! french/american! the pancakes are insane🥞
@delilahlv a fav, love the one in la, the one is vegas is very extravagant/swanky gatsby vibes, live music + a dj, everything is amazing
@vanderpumpvegas aesthetically stunning, the drinks are all fun! went because @bravo🫶🏼
@noburestaurants japanese cuisine, best sushi, the yellowtail jalapeño + the lychee martini are both 10/10! 
@innout you already know❤️
@chicarestaurants spanish fusion! went for brunch! they had a dj + it was fun!
@cabowabolv mexican dive restaurant right in the centre of the strip! perfect quick lunch spot for a tacos, a marg and some of vegas’ best people watching imo 

THINGS WE DID:
helicopter of the grand canyon: it was incredible! it was perfect for the amount of time we had there: 45 minute helicopter ride each way! once you get to the canyon they have a little picnic for you with drinks, snacks + bubbly🥂 @maverickhelicopters 

@thedrybar we love a good blow out, add a cocktail and a dj to that before we went out and we were living!

shows!!! saw @absinthe_vegas the first night which was SO good! very funny/all the acts were really good! then we saw @cirquedusoleil on the last night which was also great! the water aspect was wild! 

strolled the strip and all it’s glory✨ all the hotels are so over the top and unique so it took the whole afternoon which was great!

bellagio fountains i could literally watch all day🙌🏼

@theneonmuseumlasvegas it’s off the strip but a cute activity if you have time! go for sunset! the sky with the lights is perfect✨

this trip stayed at @parisvegas ✨
